import React from "react";
import PropTypes from "prop-types";
import { Button } from "antd";
import { loginAction } from "../reducers/user";

const LoginForm = () => {
  const aa = () => {
    loginAction();
  };

  return <Button onClick={aa}>Hello, LoginForm</Button>;
};

LoginForm.propTypes = {};

export default LoginForm;
